import React, { useState, useEffect, useCallback } from 'react';
import { Link } from 'react-router-dom';
import { MessageSquare, LogOut, Plus, Bot } from 'lucide-react';
import axios from 'axios';
import './Dashboard.css';

const Dashboard = ({ user, onLogout }) => {
  const [chats, setChats] = useState([]);
  const [loading, setLoading] = useState(true);

  const fetchChats = useCallback(async () => {
    try {
      const response = await axios.get(`/api/chat/${user.id}`);
      setChats(response.data);
    } catch (error) {
      console.error('Error fetching chats:', error);
    } finally {
      setLoading(false);
    }
  }, [user.id]);

  useEffect(() => {
    fetchChats();
  }, [fetchChats]);

  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <div className="header-content">
          <div className="logo-section">
            <Bot size={32} className="logo-icon" />
            <h1>AI ChatBot Assistant</h1>
          </div>
          <div className="header-actions">
            <span>Welcome, {user.username}</span>
            <button onClick={onLogout} className="btn btn-secondary">
              <LogOut size={16} />
              Logout
            </button>
          </div>
        </div>
      </header>

      <div className="dashboard-content">
        <div className="chatbot-main">
          <div className="welcome-section">
            <div className="welcome-card">
              <Bot size={64} className="welcome-icon" />
              <h2>Welcome to AI ChatBot Assistant</h2>
              <p>Start a conversation with your AI assistant. Ask questions, get help with coding, or just chat!</p>
              <Link to="/chat" className="btn btn-primary start-chat-btn">
                <MessageSquare size={20} />
                Start New Chat
              </Link>
            </div>
          </div>

          <div className="chats-section">
            <div className="section-header">
              <h3>Recent Conversations</h3>
              <Link to="/chat" className="btn btn-primary">
                <Plus size={16} />
                New Chat
              </Link>
            </div>
            
            {loading ? (
              <div className="loading">Loading chats...</div>
            ) : chats.length === 0 ? (
              <div className="empty-state">
                <MessageSquare size={48} />
                <h3>No conversations yet</h3>
                <p>Start your first chat with the AI assistant</p>
                <Link to="/chat" className="btn btn-primary">
                  Start Chatting
                </Link>
              </div>
            ) : (
              <div className="chats-grid">
                {chats.map(chat => (
                  <Link 
                    key={chat._id} 
                    to={`/chat/${chat._id}`} 
                    className="chat-card"
                  >
                    <div className="chat-card-header">
                      <MessageSquare size={20} />
                      <h4>{chat.title}</h4>
                    </div>
                    <p className="chat-date">{new Date(chat.updatedAt).toLocaleDateString()}</p>
                  </Link>
                ))}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
